              <div className="table-column">  </div>
              <div className="table-column"> </div>
              <div className="table-column"> </div>
              <div className="table-column"> </div>
             </Fragment>
            {AllMovements()}
            {AllIncomes()}
            {AllEgress()}

        </Fragment>
    )
}

export default MovementsTable;
